import React, { Component } from 'react';
import './AdminHome.css';
import NavDropdown from 'react-bootstrap/NavDropdown';
import Nav from 'react-bootstrap/Nav';
import Navbar from 'react-bootstrap/Navbar';
import FormControl from 'react-bootstrap/FormControl';
import Container from 'react-bootstrap/Container';
import Card from 'react-bootstrap/Card';
import Button from 'react-bootstrap/Button';
import { Link } from 'react-router-dom';
import {
  withRouter
} from 'react-router-dom';
import Form from 'react-bootstrap/Form';

class NavWithDropDown extends Component {
    render(){
        return(
            <Container>
                <Navbar fixed="top" id="top-navbar" bg="dark" variant="dark">
                        <Navbar.Brand href="/adminHome">StockChart</Navbar.Brand>
                        <Nav className="mr-auto">
                        <Nav.Link href="/importData">Import Data</Nav.Link>
                        <Nav.Link href="/company">Manage Company</Nav.Link>
                        <Nav.Link href="/exchange">Manage Exchange</Nav.Link>
                        <Nav.Link href="/ipo">Manage IPO</Nav.Link>
                        </Nav>
                    
                        <Form inline>
                        <FormControl id="search-box" type="text" placeholder="Search For Company" className="mr-sm-2" />
                        <Button variant="outline-info">Search</Button>
                        <NavDropdown title="Admin" id="nav-dropdown">
                            <NavDropdown.Item eventKey="4.1">Update Profile</NavDropdown.Item>
                        <NavDropdown.Divider />
                        <NavDropdown.Item eventKey="4.4">Logout</NavDropdown.Item>
                    </NavDropdown>
                        </Form>
                        
                    </Navbar>
                    <br />
            </Container>
        );
    }
}
class AdminHome extends Component {
    render(){
        return(
            <NavWithDropDown />
        );
    }
}

export default AdminHome;
